3	Programme d'inclusion financière communautaire et de récompense	Ce projet vise à développer une plateforme numérique de gestion d’un programme d’inclusion financière communautaire, axé sur la protection de l’environnement, la préservation des écosystèmes et la promotion des énergies renouvelables. Il a pour objectif de renforcer la participation économique des populations locales tout en les incitant à adopter des comportements durables et écoresponsables.\r\n\r\nÀ travers ce système, les membres de la communauté peuvent accéder à des services financiers inclusifs (épargne, microcrédit, transferts), tout en étant récompensés pour leurs actions en faveur de l’environnement, telles que :\r\n\r\nLe recyclage de déchets,\r\n\r\nLa participation à des projets de reforestation,\r\n\r\nL’adoption de pratiques agricoles durables,\r\n\r\nL’utilisation d’équipements solaires ou d’énergies renouvelables,\r\n\r\nLa réduction de leur empreinte carbone.\r\n\r\nDe gérer les profils des participants,\r\n\r\nDe suivre les transactions et les initiatives écologiques réalisées,\r\n\r\nD'attribuer automatiquement des points de récompense,\r\n\r\nDe convertir ces points en avantages sociaux ou financiers,\r\n\r\nDe produire des rapports d’impact environnemental et socio-économique.\r\n\r\nCe projet s’inscrit dans une logique de développement durable, en liant inclusion financière et transition écologique, tout en stimulant l'engagement citoyen à l'échelle locale.\r\n\r\nste de dépense\tDétail\tCoût estimé (FCFA)\tCoût estimé (€)\r\n1. Étude de faisabilité & partenariats bancaires\tCartographie des acteurs, conventions avec banques locales\t1 500 000\t~2 300 €\r\n2. Développement de la plateforme Django (allégée)\tGestion des profils, activités écologiques, points de récompense\t4 000 000\t~6 100 €\r\n3. Interface utilisateur (web + mobile simple)\tInterface simple pour suivi d’activités et de points\t1 000 000\t~1 500 €\r\n4. Hébergement & maintenance\tServeur, nom de domaine, sécurité\t800 000\t~1 200 €\r\n5. Intégration avec les banques (rapports, API si possible)\tSuivi manuel ou semi-automatisé des flux via relevés bancaires\t1 200 000\t~1 800 €\r\n6. Formation & accompagnement local\tMbour & Ziguinchor – animateurs communautaires formés\t1 500 000\t~2 300 €\r\n7. Sensibilisation & communication environnementale\tCampagnes locales, supports éducatifs, événements verts\t1 000 000\t~1 500 €\r\n8. Gestion du système de récompense (non monétaire)\tPoints convertibles en kits solaires, bons, semences\t2 000 000\t~3 000 €\r\n9. Gestion de projet & coordination terrain\tSuivi local, collecte de données, supervision\t1 500 000\t~2 300 €\r\n10. Imprévus (10%)\tAléas techniques ou logistiques\t1 000 000\t~1 500 €\r\n\r\n✅ Total estimé :\r\n15 500 000 FCFA\r\n\r\n≈ 23 500 €	2025-07-08 01:00:03.275178+00	projects/images/6_28dzOgg.png	t	2025-07-10 01:11:22.347643+00	15500000.00
4	Promouvoir une agriculture-elevage climato-compatible	Ce projet vise à accompagner les communautés rurales dans la transition vers une agriculture et un élevage durables, résilients face aux changements climatiques. Il s’inscrit dans une logique d’adaptation locale, de protection des écosystèmes et de sécurisation des moyens de subsistance des populations agro-pasteurs.\r\n\r\nÀ travers des actions ciblées, le projet entend :\r\n\r\nPromouvoir des pratiques agricoles et pastorales respectueuses de l’environnement (agroécologie, rotation des cultures, compostage, pâturage contrôlé, etc.).\r\n\r\nRéduire les émissions de gaz à effet de serre issues des activités rurales.\r\n\r\nAméliorer la productivité tout en préservant les ressources naturelles (sols, eau, biodiversité).\r\n\r\nRenforcer les capacités des producteurs à travers des formations pratiques, des démonstrations de techniques innovantes et des échanges de savoirs locaux.\r\n\r\nIntégrer l’élevage dans une approche agro-sylvo-pastorale durable (ex. : cultures fourragères, haies vives, gestion collective des ressources).\r\n\r\nMettre en valeur des solutions locales d’adaptation climatique, appuyées par des données et savoirs scientifiques et traditionnels.\r\n\r\nLe projet agira en collaboration avec les agriculteurs, éleveurs, jeunes ruraux, groupements de femmes, services techniques et ONG locales pour construire des systèmes de production plus résilients, équitables et économiquement viables\r\n\r\n💰 Budget estimatif – Projet agriculture-élevage climato-compatible (2 régions)\r\nPoste de dépense\tDétail\tCoût estimé (FCFA)\tCoût estimé (€)\r\n1. Diagnostic participatif initial\tÉtudes de terrain, cartographie des pratiques locales, ciblage des bénéficiaires\t2 000 000\t~3 000 €\r\n2. Formations techniques\tAgroécologie, gestion durable des terres, agroforesterie, santé animale\t3 500 000\t~5 300 €\r\n3. Kits de démonstration agricole\tSemences locales, composteurs, outils agricoles manuels, matériel de conservation des sols\t3 000 000\t~4 600 €\r\n4. Aménagements agro-pastoraux pilotes\tAménagement de champs-écoles, puits pastoraux, haies vives, cultures fourragères\t4 500 000\t~6 900 €\r\n5. Matériel pour éleveurs\tTrousse de soins vétérinaires, abreuvoirs, semences fourragères\t2 500 000\t~3 800 €\r\n6. Encadrement & accompagnement technique\tAgents de terrain, agronomes/vétérinaires locaux (2 régions)\t4 000 000\t~6 100 €\r\n7. Sensibilisation et communication\tRadios locales, affiches, journées communautaires, échanges inter-villages\t1 500 000\t~2 300 €\r\n8. Suivi-évaluation et capitalisation\tCollecte de données, indicateurs climatiques, ateliers d’évaluation participative\t2 000 000\t~3 000 €\r\n9. Coordination régionale\tLogistique, réunions, coordination opérationnelle\t1 500 000\t~2 300 €\r\n10. Imprévus (10%)\tRéserve pour urgences techniques ou climatiques\t2 000 000\t~3 000 €\r\n\r\n✅ Total estimé :\r\n26 500 000 FCFA\r\n\r\n≈ 40 300 €	2025-07-08 02:21:30.851681+00	projects/images/slide_11.png	t	2025-07-10 01:10:29.338402+00	26500000.00
1	Education par la formation et les médias	Impliquer la population dans la protection de l’environnement et de l’écotourisme, en soutenant les plus vulnérables et en valorisant le respect du cadre de vie.\r\n\r\nCe projet vise à promouvoir l’inclusion sociale, l’accès à l’éducation et la sensibilisation citoyenne à travers la formation continue et l’usage des médias numériques. Développé dans un esprit de solidarité et d'engagement communautaire, il s’adresse prioritairement aux jeunes, femmes, éducateurs et acteurs locaux.\r\n\r\nÀ travers cette initiative, nous souhaitons :\r\n\r\nOffrir un accès libre à des ressources éducatives adaptées aux réalités locales.\r\n\r\nValoriser la formation professionnelle comme levier d'autonomie.\r\n\r\nUtiliser les médias participatifs (vidéos, podcasts, articles) pour diffuser des messages de sensibilisation sur des thématiques sociales, culturelles et environnementales.\r\n\r\nEncourager la participation citoyenne et le développement de compétences numériques.\r\n\r\nPromouvoir les valeurs de justice sociale, de protection de l’environnement et de solidarité.\r\n\r\n💰 Budget estimatif – 2 Régions (Ziguinchor & Mbour ou Thiès)\r\nPoste de dépense\tDétail\tCoût estimé (FCFA)\tCoût estimé (€)\r\n1. Conception et développement web\tPlateforme Django, gestion des contenus, interface médias\t4 000 000\t~6 100 €\r\n2. Hébergement & maintenance 1 an\tServeur cloud (OVH, DigitalOcean), nom de domaine, SSL, support\t800 000\t~1 200 €\r\n3. Production de contenus médias\tVidéos, podcasts, interviews, montages (2 régions)\t3 000 000\t~4 600 €\r\n4. Formations locales\t4 sessions par région : numérique, médias, environnement\t2 500 000\t~3 800 €\r\n5. Communication et sensibilisation\tFlyers, réseaux sociaux, événements locaux\t1 000 000\t~1 500 €\r\n6. Matériel audiovisuel\tCaméras, micros, trépieds, disques durs (usage terrain)\t2 000 000\t~3 000 €\r\n7. Animateurs/formateurs terrain\t2 personnes/région pendant 6 mois\t3 000 000\t~4 600 €\r\n8. Transport & logistique\tDéplacements régionaux, carburant, hébergements ponctuels\t1 500 000\t~2 300 €\r\n9. Électricité & connectivité locale\tInternet communautaire, énergie solaire ou groupe (si nécessaire)\t1 000 000\t~1 500 €\r\n10. Coordination & suivi-évaluation\tSupervision centrale, rapports, outils de suivi\t1 500 000\t~2 300 €\r\n11. Imprévus (10%)\tMarges pour aléas techniques ou besoins nouveaux\t2 000 000\t~3 000 €\r\n\r\n✅ Total estimé :\r\n22 300 000 FCFA\r\n\r\n≈ 34 900 €	2025-07-07 20:31:49.387274+00	projects/images/9.png	t	2025-07-10 01:10:55.600062+00	22300000.00
